  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes ten studies that
  were conducted in the coastal waters of Port Frederick. By means of simultaneous
  boat and plane surveys, investigators hoped to determine: the proportion of various
  species of waterbirds detected and counted by boat survey crews, which are also
  detected and counted by air survey crews; the variability of both boat and plane
  surveys, and the degree of annual variation in the percentage of birds counted from
  the air; and the feasibility of applying correction factors to aerial survey data
  gathered over an extensive area of southeast Alaska. The results are discussed.\",\n\t\"owner_org\":
